import React from "react";

function Experience() {
  return (
    <section data-aos="fade-right">
      <h2>Experience</h2>
      <p><strong>Nexus Incorporation (2023–2024)</strong> – Associate Project Manager</p>
      <p><strong>Axios Softwork (2021–2023)</strong> – Project Manager</p>
      <p><strong>Axios Softwork (2021)</strong> – QA Intern</p>
    </section>
  );
}

export default Experience;
